(1, 'Civilization V', 'Become Ruler of the World by establishing and leading a civilization from the dawn of man into the space age: Wage war, conduct diplomacy, discover new technologies, go head-to-head with some of history’s greatest leaders and build the most powerful empire the world has ever known.', 29.99, 'Strategy', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(2, 'The Elder Scrolls Online - Morrowind', 'Adventure awaits in this new chapter of the award-winning online series. Morrowind is on the verge of destruction, and it’s up to you to save it from a deadly Daedric threat. Embark on a dangerous journey through legendary locales, from volcanic ashlands to mushroom-filled forests.', 39.99, 'RPG', , 0);
