INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(5, 'AdVenture Capitalist', 'Hey there Fancy Pants!\r\nHave you ever found yourself queuing up for your favourite interactive adventure, only to wish for something to fill the empty space while you’re waiting? Well have WE got a deal for you! ', 9.99, 'Adventure', , 0);
