INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(7, 'PlayerUnknown\'s Battlegrounds', 'PLAYERUNKNOWN\'S BATTLEGROUNDS is a last-man-standing shooter being developed with community feedback. Starting with nothing, players must fight to locate weapons and supplies in a battle to be the lone survivor. This realistic, high tension game is set on a massive 8x8 km island with a level of detail that showcases Unreal Engine 4\'s capabilities. ', 29.99, 'Action', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(9, 'Puzzle Dimension', 'Easy to Learn\r\nThe rules for gravity and movement are easy to grasp. The objective \"Pick all the sunflowers and exit through the portal\" is simple - within minutes you will move in 3D structures and solve puzzles never seen before.', 2.99, 'Puzzle', , 0);
