INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(12, 'The Witcher 3: Wild Hunt - Expansion Pass', 'The Expansion Pass secures your access to two epic adventures set in the vibrant world of monster hunter Geralt of Rivia.\r\nHearts of Stone will take Geralt on an all-new 10-hour adventure into the wilds of No Mans Land and the nooks and alleys of Oxenfurt, where he will try to complete a contract from the mysterious Man of Glass.', 24.99, 'Adventure', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(13, 'Don\'t Starve', 'Don’t Starve is an uncompromising wilderness survival game full of science and magic.', 14.99, 'Adventure', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
