INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(15, 'Drawn: The Painted Tower', 'Enter the world of Drawn, and unravel the secrets of the Painted Tower. Overcome challenging puzzles on your quest to save Iris. A curse has locked each floor of the tower, and only the most creative adventurer can find a way through.', 9.99, 'Puzzle', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(16, 'One Bit', 'Onebit,\r\nThis is the story of Onebit, a poor, cute character that is continious searching for a pixel someone has stolen from him.\r\nHe simply can`t go on with his life knowing that he is missing a pixel. ', 4.99, 'Puzzle', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(17, 'Mark of the Ninja', 'In Mark of the Ninja, you\'ll know what it is to truly be a ninja. You must be silent, agile and clever to outwit your opponents in a world of gorgeous scenery and flowing animation. Marked with cursed tattoos giving you heightened senses, every situation presents you with options. Will you be an unknown, invisible ghost, or a brutal, silent assassin?', 14.99, 'Puzzle', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(18, 'klocki', '\"klocki” is my second puzzle game after successful \"Hook\". \r\nIts a relaxing and minimal experience. Loaded with a lot of different puzzle mechanics. \r\nThank you for playing and your support!', 0.84, 'Puzzle', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(19, 'BioShock Infinite', 'Indebted to the wrong people, with his life on the line, veteran of the U.S. Cavalry and now hired gun, Booker DeWitt has only one opportunity to wipe his slate clean. He must rescue Elizabeth, a mysterious girl imprisoned since childhood and locked up in the flying city of Columbia.', 29.99, 'Action', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(20, 'Terraria', 'Dig, Fight, Explore, Build: The very world is at your fingertips as you fight for survival, fortune, and glory. Will you delve deep into cavernous expanses in search of treasure and raw materials with which to craft ever-evolving gear, machinery, and aesthetics?', 9.99, 'Adventure', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(21, 'Half-Life 2', '1998. HALF-LIFE sends a shock through the game industry with its combination of pounding action and continuous, immersive storytelling. Valve\'s debut title wins more than 50 game-of-the-year awards on its way to being named \"Best PC Game Ever\" by PC Gamer, and launches a franchise with more than eight million retail units sold worldwide.', 9.99, 'Action', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(22, 'Mass Effect 2', 'Two years after Commander Shepard repelled invading Reapers bent on the destruction of organic life, a mysterious new enemy has emerged. On the fringes of known space, something is silently abducting entire human colonies. Now Shepard must work with Cerberus, a ruthless organization devoted to human survival at any cost, to stop the most terrifying threat mankind has ever faced. ', 29.99, 'RPG', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(23, 'DARK SOULS III', 'As fires fade and the world falls into ruin, journey into a universe filled with more colossal enemies and environments. Players will be immersed into a world of epic atmosphere and darkness through faster gameplay and amplified combat intensity. Fans and newcomers alike will get lost in the game hallmark rewarding gameplay and immersive graphics. \r\nNow only embers remain… Prepare yourself once more and Embrace The Darkness!', 59.99, 'Action', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(24, 'Warframe: Vigor Pinnacle Pack', 'They were called Tenno. Warriors of blade and gun: masters of the Warframe armor. Those that survived the old war were left drifting among the ruins. Now they are needed once more.\r\nThe Grineer, with their vast armies, are spreading throughout the solar system. A call echoes across the stars summoning the Tenno to an ancient place. They summon you.', 39.99, 'Action', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(25, 'Amnesia: The Dark Descent', 'The last remaining memories fade away into darkness. Your mind is a mess and only a feeling of being hunted remains. Amnesia: The Dark Descent, a first person survival horror. A game about immersion, discovery and living through a nightmare. An experience that will chill you to the core.\r\nYou stumble through the narrow corridors as the distant cry is heard.', 19.99, 'FPS', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(26, 'Fallout 4', 'As the sole survivor of Vault 111, you enter a world destroyed by nuclear war. Every second is a fight for survival, and every choice is yours. Only you can rebuild and determine the fate of the Wasteland. Welcome home.', 29.99, 'RPG', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(27, 'Dishonored', 'Dishonored is an immersive first-person action game that casts you as a supernatural assassin driven by revenge. With Dishonored’s flexible combat system, creatively eliminate your targets as you combine the supernatural abilities, weapons and unusual gadgets at your disposal. Pursue your enemies under the cover of darkness or ruthlessly attack them head on with weapons drawn. The outcome of each mission plays out based on the choices you make.', 9.99, 'Action', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(28, 'Tomb Raider', 'Tomb Raider explores the intense and gritty origin story of Lara Croft and her ascent from a young woman to a hardened survivor. Armed only with raw instincts and the ability to push beyond the limits of human endurance, Lara must fight to unravel the dark history of a forgotten island to escape its relentless hold. Download the Turning Point trailer to see the beginning of Lara’s epic adventure.', 19.99, 'Adventure', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(29, 'Surgeon Simulator: Experience Reality', 'Surgeon Simulator is bringing the ER to VR! The most critically acclaimed and infamous surgery simulation game as you have never seen it before! Built for Vive and featuring all of the surgeries and twisted humour of the original favourite plus a few new surprises…\r\nSurgeon Simulator: Experience Reality transports you into some of the most unlikely and possibly unsanitary surgeries possible. ', 19.99, 'Simulator', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(30, 'Beans: The Coffee Shop Simulator', 'We have worked tirelessly to create this Glib Activity Management Escapism: or G.A.M.E. for short. Quickly! Before your short finite existence on this small wet rock hurtling around the sun ends you can find new meaning for yourself by playing this G.A.M.E. Or at least have some fun for a while and chase away the specter of your own mortality with about five hours of \"polished\" simulation \"fun\".', 4.99, 'Simulator', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(31, 'Sailaway - The Sailing Simulator', 'In Sailaway, the oceans of the planet have been recreated with unparalleled accuracy; making a trip across the Pacific take months, just as it would on a real boat. With a persistent online world, adjust your settings and your boat will continue to sail even if you aren’t online. Receive updates via email as your boat continues its progress, but don\'t forget to check in often – with real-time weather data pulled from the National Oceanic and Atmospheric Administration (NOAA) conditions can change in just a few hours.', 39.99, 'Simulator', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(32, 'Rat Simulator', 'No longer do you need to wonder what they get up to when humans are around, as this state-of-the-art computer simulation models the complete rat experience. As a rat, you\'ll get to steal food, wreck havoc and create chaos whenever you feel like it. This terrifies the humans who fear you and will fight back by calling pestmen to exterminate you.', 8.99, 'Simulator', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(33, 'Fireworks Simulator', 'Fireworks fascination - All eyes are on the sky, the music starts, the first spectacular effects explode high in the air, open mouths, loud \"Ooohs\" and \"Aaahs\" from the crowd. Anyone who\'s ever witnessed live fireworks knows just how spellbinding a well put-together display can be.\r\nAttention, all firework fans! Devote yourself to the supreme discipline and create your own, individual fireworks display synchronized to music. Become a pro pyrotechnician!', 9.99, 'Simulator', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(34, 'Borderlands 2', 'A new era of shoot and loot is about to begin. Play as one of four new vault hunters facing off against a massive new world of creatures, psychos and the evil mastermind, Handsome Jack. Make new friends, arm them with a bazillion weapons and fight alongside them in 4 player co-op on a relentless quest for revenge and redemption across the undiscovered and unpredictable living planet.', 19.99, 'FPS', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(35, 'Fallout: New Vegas', 'Welcome to Vegas. New Vegas.\r\nIts the kind of town where you dig your own grave prior to being shot in the head and left for dead…and thats before things really get ugly. Its a town of dreamers and desperados being torn apart by warring factions vying for complete control of this desert oasis. Its a place where the right kind of person with the right kind of weaponry can really make a name for themselves, and make more than an enemy or two along the way.', 9.99, 'FPS', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(36, 'F.E.A.R.', 'Be the hero in your own cinematic epic of action, tension and terror. A mysterious paramilitary force infiltrates a multi-billion dollar aerospace compound, taking hostages but issuing no demands. The government responds by sending in a Special Forces team only to have them obliterated. Live footage of the massacre shows an inexplicable wave of destruction tearing the soldiers apart. ', 9.99, 'FPS', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(37, 'Bastion', 'Bastion is an action role-playing experience that redefines storytelling in games, with a reactive narrator who marks your every move. Explore more than 40 lush hand-painted environments as you discover the secrets of the Calamity, a surreal catastrophe that shattered the world to pieces. Wield a huge arsenal of upgradeable weapons and battle savage beasts adapted to their new habitat.', 14.99, 'Adventure', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(38, 'Factorio', 'Factorio is a game in which you build and maintain factories. You will be mining resources, researching technologies, building infrastructure, automating production and fighting enemies. In the beginning you will find yourself chopping trees, mining ores and crafting mechanical arms and transport belts by hand, but in short time you can become an industrial powerhouse, with huge solar fields, oil refining and cracking, manufacture and deployment of construction and logistic robots, all for your resource needs.', 20, 'Strategy', , 0);
INSERT INTO `product` (`productID`, `productName`, `description`, `price`, `category`, `image`, `is_deleted`) VALUES
(39, 'RimWorld', 'RimWorld is a story generator. Its designed to co-author tragic, twisted, and triumphant stories about imprisoned pirates, desperate colonists, starvation and survival. It works by controlling the random events that the world throws at you. Every thunderstorm, pirate raid, and traveling salesman is a card dealt into your story by the AI Storyteller. There are several storytellers to choose from. Randy Random does crazy stuff, Cassandra Classic goes for rising tension, and Phoebe Chillax likes to relax.', 29.99, 'Strategy', , 0);
